  "title": {
    "nb": "Grunnkretser og delområder"
  },
  "description": {
    "nb": "Siste datasett viser inndelingen i grunnkretser og delområder. Norge er delt inn i rundt 15 000 grunnkretser, som igjen er gruppert til rundt 1 550 delområder. Formålet med å dele kommunen inn i grunnkretser er å lage små, stabile geografiske enheter.Datasettet inneholder 8-sifret kode, nivånummer og navn. De fire første sifrene i koden utgjør kommunenummeret. Delområder vil ha 00 som siste to siffer. Nivånummeret har verdien 1 for delområde og 2 for grunnkrets. Se Statistisk sentralbyrå Klassifikasjoner og kodelister (Klass) for tidligere versjoner."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eSiste datasett viser inndelingen i grunnkretser og delområder. Norge er delt inn i rundt 15 000 grunnkretser, som igjen er gruppert til rundt 1 550 delområder. Formålet med å dele kommunen inn i grunnkretser er å lage små, stabile geografiske enheter.\u003c/p\u003e\u003cp\u003eDatasettet inneholder 8-sifret kode, nivånummer og navn. De fire første sifrene i koden utgjør kommunenummeret. Delområder vil ha 00 som siste to siffer. Nivånummeret har verdien 1 for delområde og 2 for grunnkrets. Se Statistisk sentralbyrå Klassifikasjoner og kodelister (Klass) for tidligere versjoner.\u003c/p\u003e"
