  "title": {
    "nb": "API mot SSBs statistikkbank",
    "en": "StatBank Norway API from Statistics Norway"
  },
  "description": {
    "nb": "Statistisk sentralbyrå tilbyr to API mot Statstikkbanken på https://www.ssb.no/omssb/tjenester-og-verktoy/api. Statistikkbanken har over 6000 tabeller og dekker de fleste samfunnsområder, med mange tabeller på fylkes-, kommune-, bydels- og grunnkretsnivå. I tillegg er økonomiske indikatorer sentralt. Statistikkbanken inkluderer også KOSTRA nøkkeltall og grunnlagsdata.API-et er delt i to:API med ferdige datasett. Her er 250 ferdige datasett fra de mest brukte tabellene.API: Lag egne datasett, dekker alle 5000 tabellene i Statistikkbanken.Her må du selv definere spørringer etter datasett. Vi har utviklet en konsoll som gir et ferdig utkast til en spørring. I konsollen kan du redigere og teste spørringen og få resultatet ut i ulike formater. Spørringer formuleres i JSON. grensene i API-et på 500.000 celler per spørring og maks. 30 spørringer i minuttet.API-et tilbyr formatene JSON-stat og CSV. Vi anbefaler JSON-Stat, som er et kompakt format spesielt egnet for statistiske tabeller (kuber i mange dimensjoner). Det finnes mange programbibliotek for behandling av JSON-stat (Javascript, Java, Python, R etc.). API-et er både på norsk og engelsk. ",
    "en": "Statistics Norway offer an API towards all StatBank’s tables at https://www.ssb.no/en/api/. StatBank Norway have 5000 tables covering most topics, i.e. regional data and economic indicators. The API have two parts:API: Readymade datasets. These 250 complete data sets are available from the most commonly used and popular tables in StatBank.API: Create your own dataset, covers all 5000 tables in StatBank.Here you create your own query in JSON. We have developed a console which assists the user to generate and edit the code. There is an output limit of 500.000 cells per query. This API only supports, for the time being, only http POST. Output formats can be JSON-stat or CSV. We recommend JSON-stat, which is a compact format for statistical tables (multidimensional data cubes)."
  },
  "descriptionFormatted": {
    "nb": "\u003cp\u003eStatistisk sentralbyrå tilbyr to API mot Statstikkbanken på \u003ca href\u003d\"https://www.ssb.no/omssb/tjenester-og-verktoy/api\" rel\u003d\"nofollow\"\u003ehttps://www.ssb.no/omssb/tjenester-og-verktoy/api\u003c/a\u003e. \u003c/p\u003e\u003cp\u003eStatistikkbanken har over 6000 tabeller og dekker de fleste samfunnsområder, med mange tabeller på fylkes-, kommune-, bydels- og grunnkretsnivå. I tillegg er økonomiske indikatorer sentralt. Statistikkbanken inkluderer også KOSTRA nøkkeltall og grunnlagsdata.\u003c/p\u003e\u003cp\u003eAPI-et er delt i to:\u003c/p\u003e\u003cp\u003eAPI med \u003cstrong\u003eferdige datasett\u003c/strong\u003e. Her er 250 ferdige datasett fra de mest brukte tabellene.\u003c/p\u003e\u003cp\u003eAPI: \u003cstrong\u003eLag egne datasett\u003c/strong\u003e, dekker alle 5000 tabellene i Statistikkbanken.\u003cbr\u003eHer må du selv definere spørringer etter datasett. \u003cbr\u003eVi har utviklet en konsoll som gir et ferdig utkast til en spørring. I konsollen kan du redigere og teste spørringen og få resultatet ut i ulike formater. Spørringer formuleres i JSON. grensene i API-et på 500.000 celler per spørring og maks. 30 spørringer i minuttet.\u003c/p\u003e\u003cp\u003eAPI-et tilbyr formatene JSON-stat og CSV. Vi anbefaler JSON-Stat, som er et kompakt format spesielt egnet for statistiske tabeller (kuber i mange dimensjoner). Det finnes mange programbibliotek for behandling av JSON-stat (Javascript, Java, Python, R etc.). API-et er både på norsk og engelsk. \u003c/p\u003e",
    "en": "\u003cp\u003eStatistics Norway offer an API towards all StatBank’s tables at \u003ca href\u003d\"https://www.ssb.no/omssb/tjenester-og-verktoy/api\" rel\u003d\"nofollow\"\u003ehttps://www.ssb.no/en/api/\u003c/a\u003e. \u003c/p\u003e\u003cp\u003eStatBank Norway have 5000 tables covering most topics, i.e. regional data and economic indicators. The API have two parts:\u003c/p\u003e\u003cp\u003eAPI: \u003cstrong\u003eReadymade datasets\u003c/strong\u003e. These 250 complete data sets are available from the most commonly used and popular tables in StatBank.\u003c/p\u003e\u003cp\u003eAPI: \u003cstrong\u003eCreate your own dataset\u003c/strong\u003e, covers all 5000 tables in StatBank.\u003cbr\u003eHere you create your own query in JSON. We have developed a console which assists the user to generate and edit the code. \u003cbr\u003eThere is an output limit of 500.000 cells per query. This API only supports, for the time being, only http POST. \u003c/p\u003e\u003cp\u003eOutput formats can be JSON-stat or CSV. We recommend \u003ca href\u003d\"https://json-stat.org/\" rel\u003d\"nofollow\"\u003eJSON-stat\u003c/a\u003e, which is a compact format for statistical tables (multidimensional data cubes).\u003c/p\u003e"
  },
